import React, { useState } from 'react';
import { Tabs, Tab, Box, Typography } from '@mui/material';
import TableComponent from './TableComponent';
import Avgpricetable from './avgprice_table'



const TabPanel = (props) => {
  const { children, value, index, ...other } = props;
  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box sx={{ p: 3 }}>
          {children}
        </Box>
      )}
    </div>
  );
};

const Tabtable = ({ tableData }) => {
  const [value, setValue] = useState(0);
  console.log()
  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <Box sx={{ width: '100%' }}>
      <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
        <Tabs value={value} onChange={handleChange} aria-label="table tabs">
          <Tab label="平均上架天數報表" />
          <Tab label="平均報價報表" />
          <Tab label="報價報表" />
          <Tab label="車況總表報表" />
          <Tab label="中古車商" />
        </Tabs>
      </Box>
      <TabPanel value={value} index={0}>
          {tableData["avg_selltime"] ? (
        <TableComponent tableData={tableData["avg_selltime"]} />
      ) : (
        <Typography>無資料</Typography>
      )}
      </TabPanel>
      <TabPanel value={value} index={1}>
      {tableData["avgprice_table"] ? (
      <TableComponent tableData={tableData["avgprice_table"]} />
      ) : (
        <Typography>無資料</Typography>
      )}

      </TabPanel>
      <TabPanel value={value} index={2} >
      {tableData["ask_price"] ? (
      <TableComponent tableData={tableData["ask_price"]} />
      ) : (
        <Typography>無資料</Typography>
      )}

      </TabPanel>
      <TabPanel value={value} index={3}>
      {tableData["allcardata"] ? (
      <TableComponent tableData={tableData["allcardata"]} />
      ) : (
        <Typography>無資料</Typography>
      )}

      </TabPanel>
      <TabPanel value={value} index={4}>
      {tableData["car_seller"] ? (
      <TableComponent tableData={tableData["car_seller"]} />
      ) : (
        <Typography>無資料</Typography>
      )}

      </TabPanel>
    </Box>
  );
};

export default Tabtable;
